import { connect } from 'react-redux'
import { Component } from 'react'
import { withRouter } from 'react-router'
import { mapStateToProps, mapDispatchToProps } from '../app/functions'
import Navigation from '../components/header/Navigation'
import Api from '../api/Api'


class Home extends Component<Props> {


    static getDerivedStateFromProps = async (props: Props, state: any) => {
        const { dataToken } = props.persist
        const api = new Api(dataToken.token)
        const user = await api.get('/token')
        console.log(user)
        return null
    }

    render = (): JSX.Element => {


        return (
            <>
                <Navigation />
                <div className="index">
                    <h1>Home ... </h1>
                </div>
            </>
        )
    }
}


export default withRouter(connect(mapStateToProps, mapDispatchToProps)(Home))
